	class Binaries
	{
        public static byte[] DeCompressBin(string encodedData)
        {
            byte[] encodedDataAsBytes = Convert.FromBase64String(encodedData);

            using (var compressedStream = new MemoryStream(encodedDataAsBytes))
            using (var zipStream = new GZipStream(compressedStream, CompressionMode.Decompress))
            using (var resultStream = new MemoryStream())
            {
                var buffer = new byte[4096];
                int read;

                while ((read = zipStream.Read(buffer, 0, buffer.Length)) > 0)
                {
                    resultStream.Write(buffer, 0, read);
                }

                return resultStream.ToArray();
            }
        }

        public static string DeCompress(string Base64Text)
		{
			byte[] gzBuffer = Convert.FromBase64String(Base64Text);
			
			using (MemoryStream ms = new MemoryStream())
			{
				int msgLength = BitConverter.ToInt32(gzBuffer, 0);
				ms.Write(gzBuffer, 4, gzBuffer.Length - 4);

				byte[] buffer =new byte[msgLength];

				ms.Position = 0;
				using (GZipStream zip =new GZipStream(ms, CompressionMode.Decompress))
				{
					zip.Read(buffer, 0, buffer.Length);
				}
				
				return Encoding.UTF8.GetString(buffer);
			}
		}

        public static byte[] Mimikatz()
        {
            //CompressBinary.exe Mimikatz.exe Base64String.txt
            //Mimikatz ThreadExit version
#if WIN64
            string Mimikatz = "";
            return DeCompressBin(Mimikatz);
#else
            return null;
#endif
        }

